import React from 'react';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import WebIcon from '@mui/icons-material/Web'; // For Medium
import GetAppIcon from '@mui/icons-material/GetApp'; // For download

function handleButtonClick(event, url) {
    event.stopPropagation();
    console.log(`Opening URL: ${url}`);
    window.open(url, '_blank');
  }
  
function SocialButtons() {
    const iconButtonStyle = {
      margin: '5px',
      border: '2px solid #000',
      borderRadius: '50%'
    };
  
    return (
      <div style={{ display: 'flex', gap: '10px' }}>
        <IconButton
          style={iconButtonStyle}
          color="primary"
          onClick={(event) => handleButtonClick(event, 'https://www.linkedin.com/in/samridhipramanik/')}
        >
          <LinkedInIcon />
        </IconButton>
  
        {/* <IconButton
          style={iconButtonStyle}
          color="primary"
          href="https://github.com/your-github-username"
          target="_blank"
        >
          <GitHubIcon />
        </IconButton>
  
        <IconButton
          style={iconButtonStyle}
          color="primary"
          href="https://medium.com/@your-medium-username"
          target="_blank"
        >
          <WebIcon />
        </IconButton>
  
        <IconButton
          style={iconButtonStyle}
          color="secondary"
          href="/path-to-your-resume.pdf"
          download
        >
          <GetAppIcon />
        </IconButton> */}
      </div>
    );
  }
  
  export default SocialButtons;
